5632,3463703.874416,287539.63720399997,3463703.8847020003,287539.498776,3463703.894988,287539.36034799996,3463703.905274,287539.22192,3463703.91556,287539.083492,3463703.925846,287538.94506399997,3463703.9361320003,287538.806636,3463703.946418,287538.66820799996,3463703.956704,287538.52978,3463703.96699,287538.391352,3463703.977276,287538.252924,3463703.9875620003,287538.114496,3463703.997848,287537.97606799996,3463704.008134,287526.7634,3463704.8413,287526.61294099997,3463704.852628,287526.462482,3463704.863956,287526.312023,3463704.875284,287526.161564,3463704.886612,287526.011105,3463704.89794,287525.860646,3463704.909268,287525.710187,3463704.920596,287525.559728,3463704.931924,287525.409269,3463704.943252,287525.25881,3463704.95458,287525.108351,3463704.965908,287524.957892,3463704.977236,287524.807433,3463704.988564,287524.656974,3463704.999892,287524.506515,3463705.01122,287524.356056,3463705.022548,287524.205597,3463705.033876,287524.055138,3463705.045204,287523.904679,3463705.056532,287511.7175,3463705.9741,287511.57389500004,3463705.984962,287511.43029000005,3463705.9958240003,287511.286685,3463706.006686,287511.14308,3463706.0175480004,287510.999475,3463706.0284100003,287510.85587,3463706.039272,287510.71226500004,3463706.0501340004,287510.56866000005,3463706.060996,287510.425055,3463706.071858,287510.28145,3463706.0827200003,287510.137845,3463706.093582,287509.99424,3463706.1044440004,287509.85063500004,3463706.115306,287509.70703000005,3463706.126168,287509.563425,3463706.1370300003,287509.41982,3463706.147892,287509.276215,3463706.158754,287509.13261000003,3463706.1696160003,287508.98900500004,3463706.180478";

      let origin_coord_array = str_coord.split(',');

      //加密点
      let point_string = "";
      for (let k = 2; k < origin_coord_array.length;) {

        let dxx = (parseFloat(origin_coord_array[k]) - parseFloat(origin_coord_array[k - 2])) / 40;
        let dyy = (parseFloat(origin_coord_array[k + 1]) - parseFloat(origin_coord_array[k - 1])) / 40;
        for (let n = 0; n < 40; n++) {
          if (point_string == "") {
            point_string = (parseFloat(origin_coord_array[k - 2]) + dxx * n).toString() + "," + (parseFloat(origin_coord_array[k - 1]) + dyy * n).toString();
          } else {
            point_string = point_string + "," + (parseFloat(origin_coord_array[k - 2]) + dxx * n).toString() + "," + (parseFloat(origin_coord_array[k - 1]) + dyy * n).toString();
          }
        }
        k += 2;
      }

      let coord_array = point_string.split(',');

      let convert_coord_array = [];
      for (let n = 0; n < coord_array.length;) {
        convert_coord_array.push([coord_array[n], coord_array[n + 1]]);
        n += 2;
      }


      //三维展示
      let options = {
        doc: "render_area",
        navMode: Pt.EarthControls
      };
      dl.init(options);

      let intersection = new dl.Shape({
        url: "static/map3D/suzhou_CityRoad_utm51/Intersection.shp",
        name: "intersection",
        color: dl.styles.intersection.color
      });

      let crosswalk = new dl.Shape({
        url: "static/map3D/suzhou_CityRoad_utm51/Crosswalk.shp",
        name: "Crosswalk",
        color: dl.styles.crosswalk.color
      });

      let lane_marking = new dl.Shape({
        url: "static/map3D/suzhou_CityRoad_utm51/Lane_marking.shp",
        name: "lane_marking",
        color: dl.styles.lane_marking.color
      });

      let lane_arrow = new dl.Shape({
        url: "static/map3D/suzhou_CityRoad_utm51/Direction_arrow.shp",
        name: "Direction_arrow",
        color: dl.styles.lane_arrow.color
      });

      let lane_boundary = new dl.Shape({
        url: "static/map3D/suzhou_CityRoad_utm51/Lane_boundary.shp",
        name: "lane_boundary",
        color: dl.styles.lane_boundary.color
      });

      // let lane_centerline = new dl.Shape({
      //     url: "../resources/shp/suzhou_CityRoad_utm51/Lane_centerline.shp",
      //     name: "lane_centerline",
      //     color: dl.styles.lanemarking_polyline.color
      // });

      dl.scene.add(intersection);
      dl.scene.add(crosswalk);
      dl.scene.add(lane_marking);
      dl.scene.add(lane_arrow);

      dl.scene.add(lane_boundary);

      // dl.scene.add(lane_centerline);

      let bbox = new THREE.Box3(new THREE.Vector3(287406.0, 3463772, 50), new THREE.Vector3(287707.0, 3463835.0, 80.0));
      dl.initView(bbox);

      // var pt = new dl.PointCloud({url:"../resources/pointclouds/suzhou/cloud.js",
      //     ptColor: Pt.PointColorType.INTENSITY_GRADIENT});

      let model = new dl.Model({url: "static/map3D/map_photo/car.3DS"});
      self.models = model;
      model.position.x = parseFloat(convert_coord_array[0][0]);
      model.position.y = parseFloat(convert_coord_array[0][1]);
      model.position.z = 12.816;
      dl.scene.add(model);

      self.coords = [parseFloat(convert_coord_array[0][0]) , parseFloat(convert_coord_array[0][1])];
      setTimeout(function () {
        dl.moveTo({
          position: [self.coords[0]+ 6, self.coords[1], 12.816],
          radius: 20,
          yaw: -Math.PI / 2,
          pitch: -0.8
        });
        model.setHeading(-Math.PI / 180 * 95);
      }, 1000)

      //动态设置位置
      $("#ceshi").click(
        function () {
          //保存上一次坐标点,初始值第一个点
          let last_coord = [parseFloat(convert_coord_array[0][0]), parseFloat(convert_coord_array[0][1])];
          //保存原始角度
          let origin_angle = -Math.PI / 2;

          //循环变量
          let m = 0;
          self.interval=setInterval(function () {
            if (m < convert_coord_array.length - 2) {
              m += 1;
            } else {
              m = 0;
              origin_angle = -Math.PI / 2;
            }

            //计算当前地图视角
            if (m == 0) {

              model.position.x = parseFloat(convert_coord_array[0][0]);
              model.position.y = parseFloat(convert_coord_array[0][1]);

              //设置车头方向
              model.setHeading(-Math.PI / 180 * 95);

              dl.moveTo({
                position: [parseFloat(convert_coord_array[0][0]) + 6,
                  parseFloat(convert_coord_array[0][1]),
                  12.816],
                yaw: -Math.PI / 2,
                pitch: -0.8
              });
            } else {

              //获取向量夹角
              let vector1 = [convert_coord_array[m][0] - convert_coord_array[m - 1][0],
                convert_coord_array[m][1] - convert_coord_array[m - 1][1], 0];
              let three_vector1 = new THREE.Vector3(vector1[0], vector1[1], vector1[2]);
              let vector2 = [convert_coord_array[m + 1][0] - convert_coord_array[m][0],
                convert_coord_array[m + 1][1] - convert_coord_array[m][1], 0];
              let three_vector2 = new THREE.Vector3(vector2[0], vector2[1], vector2[2]);
              let realtime_angle = three_vector2.angleTo(three_vector1);

              //计算两向量叉乘方向
              let value = vector1[0] * vector2[1] - vector1[1] * vector2[0];
              if (value >= 0) {
                origin_angle += realtime_angle;
              } else {
                origin_angle -= realtime_angle;
              }

              //保证摄像机旋转角度在-2*Math.PI 到2*Math.PI之间
              if (Math.abs(origin_angle) >= 2 * Math.PI) {
                if (origin_angle < 0) {
                  origin_angle += 2 * Math.PI;
                } else {
                  origin_angle -= 2 * Math.PI;
                }
              }

              model.setHeading(origin_angle);

              model.position.x = parseFloat(convert_coord_array[m][0]);
              model.position.y = parseFloat(convert_coord_array[m][1]);

              //设置相机位置（目的：让车靠近屏幕底部）
              let yaw = origin_angle;
              let offset_x = Math.abs(Math.sin(origin_angle)) * 6;
              let offset_y = Math.abs(Math.cos(origin_angle)) * 6;
              //判断x,y偏移量是正还是负
              if (parseFloat(convert_coord_array[m][0]) < last_coord[0]) {
                offset_x = -offset_x;
              }
              if (parseFloat(convert_coord_array[m][1]) < last_coord[1]) {
                offset_y = -offset_y;
              }

              dl.moveTo({
                position: [parseFloat(convert_coord_array[m][0]) + offset_x, parseFloat(convert_coord_array[m][1]) + offset_y, 12.816],
                yaw: yaw,
                pitch: -0.8
              });
            }
            //记录本次坐标点
            last_coord = [parseFloat(convert_coord_array[m][0]), parseFloat(convert_coord_array[m][1])];
          }, 17)
        }
      )
    }
  }
